import React, { Component } from 'react'
import './footer.css';

class Footer extends Component {
    render() {
        return (
            <React.Fragment>
                <section id='footer'>
                    <div className='footer'>
                        <span>COPYRIGHT 2020 | <em>General Discount Cleaning</em> | All Rights Reserved</span>
                    </div>
                </section>  
            </React.Fragment>
        )
    }
}

export default Footer;
